import React from "react";

const HeaderComponent = () => {
  return (
    <header>
      <div>
        <ul>
          <li>메뉴1</li>
          <li>메뉴2</li>
          <li>메뉴3</li>
        </ul>
      </div>
    </header>
  );
};

export default HeaderComponent;
